    cy
    .readFile(SNAPSHOT_FILENAME, 'utf-8', { log: false })
    .then(evaluateLoadedSnapShots)
    // no way to catch an error yet
  }

function () {
  // Unit tests do not require registration
  if (!Cypress.env('unit')) {
    _cypressAppControls.api.registerDefaultUserIfNeeded();
  }
}

function () {
      _cypressAppControls.server.spy('GET', _cypressAppControls.server.paths.openCMSItem).as('open-cms-item');

      cy.step('Load a snapshot with at least one pre-made CMS collection');
      workspace = _cypressAppControls.api.importSnapshot(_cypressAppControls.snapshots.CMS.fiveDummyItems);
      cy.step('Click the CMS button on the left sidebar to open the panel');
      cmsTab = workspace.getLeftSidebar().clickCMSButton();
      cy.step('Click to open the Dummy Items collection');
      collectionPanel = cmsTab.getCollectionByName('Testers').clickCollectionTab();
      cy.wait('@open-cms-item');
    }

function saveSnapshots () {
    if (storeSnapshot) {
      const snapshots = storeSnapshot()
      console.log('%d snapshot(s) on finish', countSnapshots(snapshots))
      console.log(snapshots)

      snapshots.__version = Cypress.version
      const s = JSON.stringify(snapshots, null, 2)
      const str = `module.exports = ${s}\n`
      cy.writeFile(SNAPSHOT_FILENAME, str, 'utf-8', { log: false })
    }
  }

