function () {
      cy.step('Click the settings button');
      collectionSettings = collectionPanel.clickSettingsButton();
      cy.step('Assert that the collection settings form is open');
      collectionSettings.getHeading().contains('Tester Settings').should('exist');
      cy.step('Close all UI panels');
      workspace.escapeAllUiPanels();
    }

function () {
      cy.step('Click the CMS button on the left sidebar to open the panel');
      cmsTab = workspace.getLeftSidebar().clickCMSButton();
      cy.step("Click the 'Add Field' button");
      var fieldOptions = collectionSettings.clickAddFieldButton();
      cy.step("Add a new 'PlanText' field");
      fieldOptions.clickOption('PlainText').fill(plainTextField).clickSaveButton();
      cy.step('Assert that the new text field exists within the collection form');
      collectionSettings.getCustomFieldsList().should('be.visible').and('contain', 'Test Text Field');
      cy.step('Save the changes to the collection');
      collectionSettings.clickSaveCollectionButton();
    }

function () {
      cy.step('Click to open the first collection item');
      collectionPanel.clickCollectionItem('Natus Porro Quos');
      cy.step('Asseert that the custom text field exists');
      cy.getByDataAutomationId('dyn-item-test-text-field-input').should('exist').and('have.value', '');
      cy.step('Close all UI panels');
      workspace.escapeAllUiPanels();
    }

function () {
      cy.step('Click the CMS button on the left sidebar to open the panel');
      cmsTab = workspace.getLeftSidebar().clickCMSButton();
      cy.step('Click to open the Dummy Items collection');
      cmsTab.getCollectionByName('Testers').clickCollectionTab();
      cy.step('Click the settings button');
      collectionSettings = collectionPanel.clickSettingsButton();
      cy.step('Click the Test Text field');
      var fieldSettings = collectionSettings.clickCustomField(plainTextField.label);
      cy.step('Remove the field');
      fieldSettings.remove();
      cy.step('Assert that the text field no longer exists exists');
      collectionSettings.getCustomFieldsList().contains('Test Text Field').should('not.exist');
      cy.step('Save the changes to the collection');
      collectionSettings.clickSaveCollectionButton();
    }

function () {
