function () {
    var firstClass = 'qa-div';
    var secondClass = 'qa-new-div';
    var stylesTab = workspace.getRightPanel().clickStylesTab();
    var backgrounds = stylesTab.properties.backgrounds;
    cy.step("Add div with class \".".concat(firstClass, "\""));
    workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('DivBlock');
    workspace.getRightPanel().clickStylesTab().selector.setClassNames([firstClass]);
    cy.step("Add background color: yellow to class \".".concat(firstClass, "\""));
    workspace.getRightPanel().clickStylesTab().properties.backgroundColor.input.openPicker().setHex('yellow').close();
    var item = backgrounds.input.clickAddButton();
    item.clickSolidColorType().color.setValue('yellow');
    cy.step('Assert background color on canvas');
    canvas.within(function () {
      cy.get(".".concat(firstClass)).should('have.css', 'background-color').and('match', /(rgb\(255, 255, 0\)|yellow)/);
    });
    cy.step('Publish site');
    workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function (href) {
      cy.step('Verify site');

      _cypressAppControls.PublishedUtils.verifyCssAttributeOnPublishedSite(href, {
        className: firstClass,
        css: '#ff0'
      });
    });
    cy.step('Close Publish window');
    workspace.getTopbar().clickPublishButton();
    cy.step('Close all open UIs');
    workspace.escapeAllUiPanels();
    cy.step("Select .".concat(firstClass, " on canvas"));
    canvas.selectElement(".".concat(firstClass));
    cy.step("Rename class to: \"".concat(secondClass, "\""));
    workspace.getRightPanel().clickStylesTab().selector.renameClass(firstClass, secondClass);
    cy.step('Publish site');
    workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function (href) {
      cy.step('Verify site');

      _cypressAppControls.PublishedUtils.verifyCssAttributeOnPublishedSite(href, {
        className: secondClass,
        css: '#ff0'
      });
    });
  }

