function () {
    _cypressAppControls.api.verifyUser();

    workspace = _cypressAppControls.api.importSnapshot(_cypressAppControls.snapshots.empty);
    cy.step('Add div element with class .qa-div');
    workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('DivBlock');
    workspace.getRightPanel().clickStylesTab().selector.setClassNames(['qa-div']);
    cy.step('Add background color: yellow to class .qa-div');
    stylesTab = workspace.getRightPanel().clickStylesTab();
    var picker = stylesTab.properties.backgroundColor.input.openPicker();
    picker.setHex('yellow');
    picker.close();
    cy.step('Assert .qa-div has yellow background');
    canvas = workspace.getCanvas();
    canvas.within(function () {
      cy.get('.qa-div').should('have.css', 'background-color').and('match', /(rgb\(255, 255, 0\)|yellow)/);
    });
    cy.step('Create new Contact page');
    var pageManager = workspace.getLeftSidebar().clickPagesTab();
    var form = pageManager.clickAddNewPageButton();
    form.fill({
      name: 'Contact'
    }).clickCreateButton();
    workspace.getTopbar().getPageMenu().getPageName().should('contain', 'Contact');
    cy.step('Add heading element');
    workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('Heading');
    workspace.getRightPanel().clickStylesTab().selector.setClassNames(['qa-heading']);
    cy.step('Replace heading text');
    workspace.escapeAllUiPanels();
    canvas.type('.qa-heading', 'Contact Us');
    cy.step('Publish site');
    workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function (href) {
      Cypress.env('pageUrl', href);
      cy.forceVisit(href);
      cy.get('.qa-heading').should('exist').and('be.visible').and('have.text', 'Contact Us');
      var homePageUrl = href.substring(0, href.lastIndexOf('/'));
      cy.forceVisit(homePageUrl);
      cy.get('.qa-div').should('exist').and('have.css', 'background-color').and('match', /(rgb\(255, 255, 0\)|yellow)/);
    });
  }

