function loadSnapshots () {
    cy
    .readFile(SNAPSHOT_FILENAME, 'utf-8', { log: false })
    .then(evaluateLoadedSnapShots)
    // no way to catch an error yet
  }

function () {
  // Unit tests do not require registration
  if (!Cypress.env('unit')) {
    _cypressAppControls.api.registerDefaultUserIfNeeded();
  }
}

function () {
    _cypressAppControls.api.upgradePlan();

    workspace = _cypressAppControls.api.importSnapshot('jaakko-l7g8wm/f3e0a40b-4fb3-45c0-a549-73b0e604388d.v1-lite');
    canvas = workspace.getCanvas();
  }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Products Template');
    }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Regional Offices Template');
    }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Shopping Cart'); // open the shopping cart

      canvas.selectElement('.w-commerce-commercecartopenlink').then(function () {
        workspace.getRightPanel().clickPropertiesTab();
        cy.get('[data-automation-id="cart-toggle-button"]').click();
      });
    }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Checkout');
    }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Checkout (PayPal)');
    }

function () {
      workspace.getLeftSidebar().clickPagesTab().switchPage('Order Confirmation');
    }

function saveSnapshots () {
    if (storeSnapshot) {
      const snapshots = storeSnapshot()
      console.log('%d snapshot(s) on finish', countSnapshots(snapshots))
      console.log(snapshots)

      snapshots.__version = Cypress.version
      const s = JSON.stringify(snapshots, null, 2)
      const str = `module.exports = ${s}\n`
      cy.writeFile(SNAPSHOT_FILENAME, str, 'utf-8', { log: false })
    }
  }

