      // go to the page that contains the binding context
      workspace.getLeftSidebar().clickPagesTab().switchPage('Collection List of Plain CMS Items'); // select the test element inside the binding context

      canvas.selectElement('.w-dyn-list').then(function () {
        filterSettings = workspace.getRightPanel().clickPropertiesTab().collectionListSettings.createFilterSettings(); // add a placeholder passing condition

        filterSettings.addFilter({
          name: 'Name',
          operator: 'Does Not Equal',
          value: 'PLACEHOLDER'
        });
      });
    }

function saveSnapshots () {
    if (storeSnapshot) {
      const snapshots = storeSnapshot()
      console.log('%d snapshot(s) on finish', countSnapshots(snapshots))
      console.log(snapshots)

      snapshots.__version = Cypress.version
      const s = JSON.stringify(snapshots, null, 2)
      const str = `module.exports = ${s}\n`
      cy.writeFile(SNAPSHOT_FILENAME, str, 'utf-8', { log: false })
    }
  }

