function loadSnapshots () {
    cy
    .readFile(SNAPSHOT_FILENAME, 'utf-8', { log: false })
    .then(evaluateLoadedSnapShots)
    // no way to catch an error yet
  }

function () {
  // Unit tests do not require registration
  if (!Cypress.env('unit')) {
    _cypressAppControls.api.registerDefaultUserIfNeeded();
  }
}

function () {
    _cypressAppControls.api.upgradePlan();

    workspace = _cypressAppControls.api.importSnapshot(_cypressAppControls.snapshots.Dynamo.bindingTargets);
    canvas = workspace.getCanvas();
  }

function () {
          // go to the page that contains the binding context
          workspace.getLeftSidebar().clickPagesTab().switchPage(contextPage); // select the test element inside the binding context

          canvas.selectElement(elementSelector).then(function () {
            var filterSettings = workspace.getRightPanel().clickPropertiesTab().collectionListSettings.createFilterSettings();
            filterSettings.addFilterAnd(function (conditionPanel) {
              panel = conditionPanel;
            });
          });
        }

function () {
          panel.close();
        }

function () {
          // go to the page that contains the binding context
